  [],\n\t\"revision_timestamp\": \"2015-08-21T22:53:48.778064\",\n\t\"name\": \"veterans-affairs-surgical-quality-improvement-program-vasqip\",\n\t\"isopen\":
  true,\n\t\"url\": null,\n\t\"notes\": \"The Veterans Affairs Surgical Quality Improvement
  Program (VASQIP) database resides in the VA National Surgery Office (NSO) and is
  a quality assurance activity-derived database containing information on all patients
  who undergo surgery within the VA. The primary purpose of this database is to improve
  the quality of care for Veterans undergoing surgery by providing information to
  care provider teams for self-assessment and quality improvement purposes. Data for
  the VASQIP database are entered by nurse data managers using Veterans Health Information
  Systems and Technology Architecture (VistA) at the VA surgical facilities. These
  data captured in VistA are securely transmitted to the VASQIP database for compilation
  and analysis. Results of the data analysis are reported from the National Surgery
  Office (NSO) for quarterly and annual review of surgical quality and patient care
  issues; these data are confidential and privileged under the provisions of 38 U.S.C.
  5705 and its implementing regulations. Note: In 2009, the Cardiac Specialty program
  (Continuous Improvement in Cardiac Surgery Program (CICSP)) was merged with the
  National Surgical Quality Improvement Program (NSQIP) for a comprehensive all-specialty
  surgical database, VASQIP.  It employs both Microsoft SQL Server and Statistical
  Analysis Software implementation.\",\n\t\"license_title\": \"Creative Commons CCZero\",\n\t\"extras\":
